export const containerStyle = {
    maxWidth: "1190px",
    margin: "0 auto",
    padding: "0px 32px",
    "@media (max-width: 800px)": {
        padding: "0px 25px",
    },
}

export const headerTextStyle = {
    fontSize: "36px",
    color: "#363636",
    fontFamily: 'ProximaNova, sans-serif',
    marginLeft: "25px",
    marginTop: "0",
    marginBottom: "0",
    "@media (max-width: 425px)": {
        fontSize: "32px",
        marginLeft: "0px",
    },
};

export const backgroundRight = {
    width: "100%",
    height: "100%",
    position: "absolute",
    left: "50%",
    marginLeft: "-595px",
    backgroundColor: "#ebf7f8",
    borderRadius: "32px",
    "@media (max-width: 1200px)": {
        left: "0",
        marginLeft: "0px",
    },
    "@media (max-width: 800px)": {
        borderRadius: "0px",
    },
}
